import BookingPage from './components/BookingPage.js';
import HomePage from './components/HomePage.js'

function Main(){
    return(
        <main>
        <Routes>
            <Route path='/' element={<HomePage></HomePage>} ></Route>
            <Route path='/booking' element={<BookingPage></BookingPage>}></Route>
        </Routes>
        </main>
    )
}

export default Main
